import React from 'react'
import { Service  } from '../../section/Index';
import './ServiceP.css'
import Slide from 'react-reveal/Slide';
 const ServiceP = () => {
   return (
    <Slide left>
     <div className='effect'>
     <Service/> 
     </div>
     </Slide>
   )
 }
 
 export default ServiceP
